import "./style/HomePage.css"

import OriginalProfile from "./../images/profile/profile.jpg"

const HomePage = () => {

    return (
        <>
            <div id="page-container">
                <div id="profile-container">
                    <img src={OriginalProfile}
                        onMouseHover={this.src = require()}
                        onMouseOut={this.src = OriginalProfile} />
                </div>
            </div>
        </>
    )
}

export default HomePage;
